  id,
  type,
  position,
  tickSizeInner,
  tickSizeOuter,
  show,
  showGrid,
  showTicks,
  styles,
  maxLabelRotation,
  labelRotationStep,
  tickPadding,
  ticks,
  tickCount,
  minTickCount,
  maxTickCount,
  scale,
  max: scaleMax,
  transform,
  vertical,
  format,
  range: [range0, range1],
  directionMultiplier,
  tickOffset,
  gridOffset,
  spacing,
